import React from 'react';
import './Navbar.css';
import pageLogo from '../assets/logo.png'; // Asegúrate de que el logo esté en la carpeta assets
import logoutIcon from '../assets/cer.png'; // Asegúrate de que el icono esté en la carpeta assets

const Navbar = () => {
    return (
        <nav className="navbar">
            <div className="logo">
                <img src={pageLogo} alt="Page Logo" />
                Expedium
            </div>
            <ul className="nav-links">
                <li>Usuarios</li>
                <li>Expedientes</li>
                <li>Documentos</li>
                <li>Perfil</li>
            </ul>
            <div className="logout-icon">
                <img src={logoutIcon} alt="Logout" />
            </div>
        </nav>
    );
}

export default Navbar;
